import '../App.css';

{/* Privacy page */}

function Privacy() {
    return (
        <div>

            <div className="center">
              <h1>Privacy Policy</h1>  
                <div className="word">
            <p>We, at ToUpper LLC, understand the importance of privacy. When you use our application services, we try to 
                make sure we give users the most up to date features. Some of these features may require to use some 
                data. We use data to build better services and to make your life easier on a day to day basis. 
                At ToUpper LLC, we do not solicit, steal, or sell our data to or from anyone. We respect every 
                individual's privacy and work hard to make sure that every user's private information is kept from public's reach.</p>

                <p>This privacy policy applies to all of our applications that are available for download on the Google Play Market or Apple App store.
